<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8" />
        <title>wdi5 documentation</title>
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="description" content="Description" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0" />
        <link type="image/x-icon" rel="icon" href="/wdi5/favicon.ico" />
        <!-- Theme: Simple Dark -->
        <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-simple-dark.css" />
    </head>

    <body>
        <div id="app"></div>
        <script>
            window.$docsify = {
                logo: "/img/wdi5-logo-small.png",
                loadSidebar: true,
                subMaxLevel: 5,
                name: "wdi5",
                repo: "https://github.com/ui5-community/wdi5",
                auto2top: true
            }
        </script>
        <!-- Docsify v4 -->
        <script src="//cdn.jsdelivr.net/npm/docsify@4"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/search.min.js"></script>
        <!-- docsify-themeable (latest v0.x.x) -->
        <script src="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/js/docsify-themeable.min.js"></script>
        <!-- docsify-tabs (latest v1.x.x) -->
        <script src="https://cdn.jsdelivr.net/npm/docsify-tabs@1"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs@1/components/prism-javascript.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs@1/components/prism-typescript.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs@1/components/prism-bash.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs@1/components/prism-diff.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs@1/components/prism-json.min.js"></script>
    </body>
</html>
